REC_FLAG = re.compile(r"wicys\[(\w+)]")
INTERVAL = 10

ap = ArgumentParser()
ap.add_argument("regex", help="RegEx pattern to search with. Wrap it in single quotes 'like this' if you experience shell issues.")


def main():
    args = ap.parse_args()

    try:
        regex_encoded = args.regex.encode("ascii")
    except UnicodeEncodeError as ex:
        print(f"unrecognized character in regex: {ex}")
        exit(2)
    try:
        regex_compiled = re.compile(regex_encoded)
    except re.error as ex:
        print(f"malformed regex: {ex}")
        exit(2)

    count = 0
    decrypted = ""
    for match in regex_compiled.finditer(BLOB):
        if count % INTERVAL == 0:
            end = match.end()
            xor_byte, encrypted_byte = BLOB[end:end + 2]
            decrypted_byte = chr(encrypted_byte ^ xor_byte)
            decrypted += decrypted_byte
        count += 1

    # no walruses here since we need to stay compatible
    match = REC_FLAG.match(decrypted)
    if match is not None:
        print(f"found unauthorized user handling TINs: {match.group(1)}")
    else:
        print("valid regex, but ill-fitting")
        exit(1)


if __name__ == "__main__":
    main()
